import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { HttpService } from '../../service/http.service';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.scss']
})
export class RegisterComponent {
  imgUrl:any;

  constructor(private http:HttpService,private router:Router ){

  }
  author={name:'',
    lastname:'',
    email:'',
    password:'',
    about:''
  }
  changeProfileImg(e:any){
      this.imgUrl=e.target.files[0]


  }
  regestier(){
    let fd=new FormData();
    fd.append('name',this.author.name)
    fd.append('lastname',this.author.lastname)
    fd.append('email',this.author.email)
    fd.append('password',this.author.password)
    fd.append('about',this.author.about)
    fd.append('image',this.imgUrl)
    this.http.CreateUserAccount(fd).subscribe(
      res=>{this.router.navigate(['./login'])}
    );
    this.router.navigate(['./'])

  }
}
